import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, useGLTF, Plane, Stars } from '@react-three/drei';

function Tent({ position, rotation = 0, color }) {
  return (
    <group position={position} rotation={[0, rotation, 0]}>
      {/* Tent body */}
      <mesh castShadow>
        <coneGeometry args={[1, 1.5, 8]} />
        <meshStandardMaterial color={color} />
      </mesh>
      {/* Tent entrance */}
      <mesh castShadow position={[0, -0.4, 0.7]}>
        <boxGeometry args={[0.8, 0.8, 0.1]} />
        <meshStandardMaterial color={color} />
      </mesh>
    </group>
  );
}

function TallTree({ position, scale = 1 }) {
  const height = 8 * scale;
  const width = 2 * scale;

  return (
    <group position={position}>
      {/* Tree trunk */}
      <mesh castShadow position={[0, height/2, 0]}>
        <cylinderGeometry args={[0.3 * scale, 0.4 * scale, height, 8]} />
        <meshStandardMaterial color="#4a3728" />
      </mesh>
      {/* Tree foliage layers */}
      {[...Array(4)].map((_, i) => (
        <mesh 
          key={i} 
          castShadow 
          position={[
            0, 
            height - (i * 1.5 * scale), 
            0
          ]}
        >
          <sphereGeometry args={[width - (i * 0.3), 16, 16]} />
          <meshStandardMaterial color={i % 2 ? "#2d4a1d" : "#1a472a"} />
        </mesh>
      ))}
    </group>
  );
}

function GrassField() {
  return (
    <Plane
      receiveShadow
      rotation={[-Math.PI / 2, 0, 0]}
      position={[0, -0.1, 0]}
      args={[100, 100]}
    >
      <meshStandardMaterial
        color="#90a959"
        roughness={1}
        metalness={0}
      />
    </Plane>
  );
}

function BackgroundHills() {
  return (
    <group position={[0, -5, -30]}>
      <mesh receiveShadow>
        <cylinderGeometry args={[40, 40, 20, 32, 1, true, 0, Math.PI]} />
        <meshStandardMaterial color="#2d4a1d" side={2} />
      </mesh>
    </group>
  );
}

function CampingScene() {
  return (
    <group>
      <GrassField />
      <BackgroundHills />

      {/* Background tall trees */}
      {[...Array(12)].map((_, i) => (
        <TallTree
          key={i}
          position={[
            -25 + (i * 4) + (Math.random() * 2),
            0,
            -15 + (Math.random() * 3)
          ]}
          scale={1 + Math.random() * 0.5}
        />
      ))}

      {/* Scattered tents */}
      <Tent position={[-8, 0, 5]} rotation={Math.PI * 0.2} color="#4299e1" />
      <Tent position={[-5, 0, 8]} rotation={Math.PI * -0.1} color="#ecc94b" />
      <Tent position={[6, 0, 7]} rotation={Math.PI * 0.15} color="#48bb78" />

      {/* Gazebo */}
      <group position={[0, 0, 8]}>
        <mesh position={[0, 1.5, 0]}>
          <boxGeometry args={[3, 0.2, 3]} />
          <meshStandardMaterial color="#795548" />
        </mesh>
        {/* Posts */}
        {[[-1, -1], [1, -1], [-1, 1], [1, 1]].map(([x, z], i) => (
          <mesh key={i} position={[x, 0.75, z]}>
            <cylinderGeometry args={[0.1, 0.1, 1.5, 8]} />
            <meshStandardMaterial color="#5d4037" />
          </mesh>
        ))}
      </group>
    </group>
  );
}

function Model() {
  const { scene } = useGLTF('/models/zomepod.glb');

  return (
    <primitive 
      object={scene} 
      scale={1} 
      position={[0, 0, 0]}
      castShadow
      receiveShadow
    />
  );
}

const ModelViewer = () => {
  return (
    <div style={{ width: '100vw', height: '100vh', background: '#87CEEB' }}>
      <Canvas 
        camera={{ position: [20, 10, 20], fov: 45 }}
        shadows
      >
        {/* Sky and ambient lighting */}
        <color attach="background" args={['#a8c7d6']} />
        <ambientLight intensity={0.7} />
        <directionalLight
          position={[10, 20, 10]}
          intensity={1.5}
          castShadow
          shadow-mapSize-width={2048}
          shadow-mapSize-height={2048}
          shadow-camera-far={50}
          shadow-camera-left={-30}
          shadow-camera-right={30}
          shadow-camera-top={30}
          shadow-camera-bottom={-30}
        />

        {/* Scene content */}
        <Suspense fallback={null}>
          <Model />
          <CampingScene />
          <Environment preset="dawn" background blur={0.6} />
        </Suspense>

        {/* Controls */}
        <OrbitControls 
          enablePan={true}
          enableZoom={true}
          enableRotate={true}
          minDistance={5}
          maxDistance={40}
          maxPolarAngle={Math.PI / 2.1}
        />
      </Canvas>
    </div>
  );
};

useGLTF.preload('/models/zomepod.glb');

export default ModelViewer;
